{
  "openapi": "3.0.3",
  "info": {
    "title": "Garnet HTTP API",
    "version": "0.0.1",
    "description": "To use the API you must first sign-in using the `POST /auth/sign-in` endpoint and collect the **Bearer token** from the response. The token can also be retreived from the Garnet Dashboard under your profile section. \n"
